✨Salmon & Potato Rice Casserole

🇯🇵サーモンとポテトのライスドリア

This is an easy meal. I cooked salmon & potato rice in the rice cooker. This salmon & potato rice is so versatile. Simply eat it as it is, as a rice casserole, fried rice ball and more.

❤️ingredients I used❤️

Salmon & potato rice:

✨Salmon
✨potato
✨rice
✨grass fed ghee
✨green pea
✨Himalayan pink salt
✨black pepper
✨soy sauce 

White sauce: 

✨grass fed  milk
✨grass fed ghee
✨parsley
✨Himalayan pink salt
✨black pepper
✨Italian dried herb
✨Parmigiano-Reggiano

